import React from "react";
import { Card } from "react-bootstrap";

const ProyectosPersonales = (props) => (
  
    <Card style={{ width: "10rem", margin: "10px" }} className="d-flex justify-content-center align-items-center ">
      <Card.Img variant="top" src={props.imagenUrl} style={{ width: "3rem", marginTop: "7px" }} />
      <Card.Body>
      <Card.Title className="m-3 d-flex justify-content-center items-center h3 small">
        {props.titulo}
      </Card.Title>
      <Card.Text style={{ fontSize: "20px", margin: "5px" }}>
      {props.descripcion}
      </Card.Text>
      </Card.Body>
    </Card>
  
);

export default ProyectosPersonales;
